import './App.css'
import Header from './components/Header';
import Navbar from './components/Navbar';

const App = () => {
  return (
    <div className='Atvk'>
      <Header />
      <Navbar />

      <div className='Content'>
        <div>
          <img src='https://img.freepik.com/free-photo/digital-painting-mountain-with-colorful-tree-foreground_1340-25699.jpg' />
        </div>
        <div>
          <img src='https://gratisography.com/wp-content/uploads/2023/02/gratisography-little-blue-monster-free-stock-photo.jpg' />
          <div>
            Discription
          </div>
        </div>
        <div>My Post</div>
        <div>New Post
          <div>Post 1</div>
          <div>Post </div>
        </div>
      </div>
    </div>
  );
}

export default App;
